$PictureBox = new-object Windows.Forms.PictureBox
$PictureBox.Location = New-Object System.Drawing.Size(50,130) 
$PictureBox.width = 280
$PictureBox.height = 280
$PictureBox.BorderStyle = "FixedSingle"
$PictureBox.sizemode = "Zoom"
$PictureBox.Margin = 10
$PictureBox.WaitOnLoad = $true
$PictureBox.Image = $noImage
$PictureBox.AllowDrop = $True
$PictureBox.Add_DragEnter(
{
	$_.Effect = [System.Windows.Forms.DragDropEffects]::All
	
	[string[]] $files = [string[]]$_.Data.GetData([System.Windows.Forms.DataFormats]::FileDrop)
	if($files -ne $null)
	{
		[string]$fileName = $files[0]
		if($fileName -imatch ".jpg" -or $fileName -imatch ".jpeg" -or $fileName -imatch ".gif" -or $fileName -imatch ".png" -or $fileName -imatch ".bmp" -or $fileName -imatch ".tif")
		{
			$PictureBox.Image = [System.Drawing.Image]::Fromfile($fileName)
		}
		else
		{
			$PictureBox.Image = $notSupportedImage
		}
		if($PreviewCancelManualButton.Visible -eq $true)
		{CancelPreview}
	}
	 
})
$PictureBox.Add_DragLeave(
{
	$PictureBox.Image = $noImage
})
$PictureBox.Add_DragDrop({
	Write-Host "Drag Drop Processing..."
	$StatusLabel.Text = "Processing..."
	[System.Windows.Forms.Application]::DoEvents()
	[string[]] $files = [string[]]$_.Data.GetData([System.Windows.Forms.DataFormats]::FileDrop)
	if($files -ne $null)
	{
		[string]$fileName = $files[0]
		if($fileName -imatch ".jpg" -or $fileName -imatch ".jpeg" -or $fileName -imatch ".gif" -or $fileName -imatch ".png" -or $fileName -imatch ".bmp" -or $fileName -imatch ".tif")
		{
			$img = [System.Drawing.Image]::Fromfile($fileName)
			$script:manualImageFile = $fileName
			ManualSmartCrop -img $img
			$splitFileName = $filename.Split("\\")
			$theFile = $splitFileName[($splitFileName.length - 1)]
			$FileLabel.Text = "File: $theFile"
			
			$ManualCheckBox.Checked = $true
			$BulkCheckBox.Checked = $false
			
			$BulkFolderTextBox.Enabled = $false
			$BulkBrowseButton.Enabled = $false
			$BrowseButton.Enabled = $true
			$UpManualButton.Enabled = $true
			$DownManualButton.Enabled = $true
			$LeftManualButton.Enabled = $true
			$RightManualButton.Enabled = $true
			$LargerManualButton.Enabled = $true
			$SmallerManualButton.Enabled = $true
			$PreviewManualButton.Enabled = $true
		}
		else
		{
			$PictureBox.Image = $notSupportedImage
			Write-Host "File type not supported." -foreground "red"
		}
	}
	
	$StatusLabel.Text = ""
	[System.Windows.Forms.Application]::DoEvents()
})
$objForm.Controls.Add($PictureBox)



