$PreviewManualButton = New-Object System.Windows.Forms.Button
$PreviewManualButton.Location = New-Object System.Drawing.Size(410,460)
$PreviewManualButton.Size = New-Object System.Drawing.Size(100,18)
$PreviewManualButton.Text = "Preview Filter"
$PreviewManualButton.TabIndex = 12
$PreviewManualButton.Add_Click(
{
	$StatusLabel.Text = "Processing..."
	[System.Windows.Forms.Application]::DoEvents()
	[string]$tempFile = $script:manualImageFile
	Write-Host "File: ${tempFile}"
	[System.Drawing.Image] $img = [System.Drawing.Image]::Fromfile("${tempFile}")
	
	#resize square to 280x280 to keep processing to a minimum
	$img = ResizeImageWidthRetainRatio -img $img -widthInPixels 280
	
	#Colourise
	[string] $colouriseString = $ColouriseDropDownBox.SelectedItem.ToString()
	if($colouriseString -ne "None")
	{
		$img = RGBFilter -img $img -Colour $colouriseString
	}
	
	#Contrast Image
	[string] $contrastString = $ContrastDropDownBox.SelectedItem.ToString()
	if($contrastString -ne "None")
	{
		$img = ContrastBoost -img $img -Amount $contrastString
	}
	
	#Brightness of Image
	$brightnessString = $BrightnessDropDownBox.SelectedItem.ToString()
	if($brightnessString -ne "None")
	{
		$img = BrightnessBoost -img $img -Amount $brightnessString
	}
	
	#Effects filter
	$effectsString = $EffectsDropDownBox.SelectedItem.ToString()
	if($effectsString -ne "None")
	{
		$img = InstaFilter -img $img -filtertype $effectsString
	}
	
	$PictureBox.Image = $img
	$StatusLabel.Text = ""
	$PreviewCancelManualButton.Visible = $true
	$PreviewManualButton.Visible = $false
	[System.Windows.Forms.Application]::DoEvents()
})
$objForm.Controls.Add($PreviewManualButton)

