#Export File button ============================================================
$ExportButton = New-Object System.Windows.Forms.Button
$ExportButton.Location = New-Object System.Drawing.Size(180,595)
$ExportButton.Size = New-Object System.Drawing.Size(120,24)
$ExportButton.Text = "Create Files!"
$ExportButton.TabIndex = 24
$ExportButton.Add_Click(
{
	$CancelButton.Visible = $true
	$ExportButton.Visible = $false
	$ManualCheckBox.Enabled = $false
	$BulkCheckBox.Enabled = $false	
	$BulkFolderTextBox.Enabled = $false
	$BulkBrowseButton.Enabled = $false
	$SmartCropCheckBox.Enabled = $false
	$MarginNumberBox.Enabled = $false
	$BrowseButton.Enabled = $false
	$UpManualButton.Enabled = $false
	$DownManualButton.Enabled = $false
	$LeftManualButton.Enabled = $false
	$RightManualButton.Enabled = $false
	$LargerManualButton.Enabled = $false
	$SmallerManualButton.Enabled = $false
	#$PictureBox.Enabled = $false
	$ColouriseDropDownBox.Enabled = $false
	$ContrastDropDownBox.Enabled = $false
	$BrightnessDropDownBox.Enabled = $false
	$EffectsDropDownBox.Enabled = $false
	$CustomNumberBox.Enabled = $false
	$QualityNumberBox.Enabled = $false
	$Size96CheckBox.Enabled = $false
	$Size648CheckBox.Enabled = $false
	$CustomSizeCheckBox.Enabled = $false
	$StatusLabel.Text = "Processing..."
	[System.Windows.Forms.Application]::DoEvents()
	
	
	[string]$OutputImagePath = $OutputFolderTextBox.text
	$lastChar = $OutputImagePath.Substring($OutputImagePath.Length - 1,1)  #Check the last char
	if($lastChar -eq "\")
	{
		$OutputImagePath = $OutputImagePath.Substring(0,$OutputImagePath.Length - 1)
	}
	
	[string]$InputImagePath = $BulkFolderTextBox.Text
	$lastChar = $InputImagePath.Substring($InputImagePath.Length - 1,1)  #Check the last char
	if($lastChar -eq "\")
	{
		$InputImagePath = $InputImagePath.Substring(0,$InputImagePath.Length - 1)
	}	
	
	if(Test-Path $InputImagePath -pathType container)
	{
	
		if(Test-Path $OutputImagePath -pathType container)
		{
			if($BulkCheckBox.Checked -eq $true)
			{
				
						
				foreach ($TempFile in Get-ChildItem $InputImagePath | Where-Object { $_.Extension -eq ".jpg" -or $_.Extension -eq ".jpeg" -or $_.Extension -eq ".gif" -or $_.Extension -eq ".png" -or $_.Extension -eq ".bmp" -or $_.Extension -eq ".tif"} )
				{
					Write-Host "Exporting File: $TempFile"
					[string]$TempFile = $TempFile
					
					[System.Drawing.Image] $img = [System.Drawing.Image]::Fromfile("${InputImagePath}\${TempFile}")
					$PictureBox.Image = $img
					[System.Windows.Forms.Application]::DoEvents()
					
					$originalImageWidth = $img.Width
					$originalImageHeight = $img.Height

					$imageCalcRatio = 0 
					
					if($originalImageWidth -lt $originalImageHeight)
					{
						$imageCalcRatio = $originalImageWidth / $SmartCropImageSize
						$processimg = ResizeImageWidthRetainRatio -img $img -widthInPixels $SmartCropImageSize
						#$PictureBox.Image = $resultImg ## Debug
						#[System.Windows.Forms.Application]::DoEvents() ## Debug
						$script:lineThickness = $originalImageWidth / 100
					}
					else
					{
						$imageCalcRatio = $originalImageHeight / $SmartCropImageSize
						$processimg = ResizeImageHeightRetainRatio -img $img -heightInPixels $SmartCropImageSize
						#$PictureBox.Image = $resultImg ## Debug
						#[System.Windows.Forms.Application]::DoEvents() ## Debug
						$script:lineThickness = $originalImageHeight / 100
					}

					if($SmartCropCheckBox.Checked -eq $true)
					{
						#Do initial processing on image
						$processimg = ProcessImage -img $processimg
						#$PictureBox.Image = $processimg ## Debug
						#[System.Windows.Forms.Application]::DoEvents() ## Debug
						
						#Erode the image
						$processimg = ErodeImage -img $processimg
						#$PictureBox.Image = $processimg ## Debug
						#[System.Windows.Forms.Application]::DoEvents() ## Debug
						
						#Erode a second time
						#$processimg = ErodeImage -img $processimg
						#$PictureBox.Image = $processimg ## Debug
						#[System.Windows.Forms.Application]::DoEvents() ## Debug
						
					}
					else
					{
						$imageCalcRatio = 1
						if($originalImageWidth -lt $originalImageHeight)
						{
							#Pack Response
							$CropCoords = @{            
								MinX = 0                 
								MaxX = $originalImageWidth           
								MinY = ($originalImageHeight / 2) - ($originalImageWidth / 2)
								MaxY = ($originalImageHeight / 2) + ($originalImageWidth / 2)
							}
						}
						else
						{
							#Pack Response
							$CropCoords = @{            
								MinX = ($originalImageWidth / 2) - ($originalImageHeight / 2)               
								MaxX = ($originalImageWidth / 2) + ($originalImageHeight / 2)           
								MinY = 0
								MaxY = $originalImageHeight
							}
						}				
					}
					
					if($Size648CheckBox.Checked)
					{
						if($SmartCropCheckBox.Checked -eq $true)
						{
							#Find cropping co-ordinates
							$CropCoords = SmartCropCoords -img $processimg -outsize 648 -scaleratio $imageCalcRatio
						}
						
						##Draw Cross Hairs for central position Lines###
						if($TempFile -imatch ".gif") #GIFs need some extra processing
						{
							$imgWithLines = [System.Drawing.Image]::Fromfile("${InputImagePath}\${TempFile}")
							$imgForGraph = New-Object System.Drawing.Bitmap($imgWithLines.Width, $imgWithLines.Height)
							[System.Drawing.Graphics] $graph = [System.Drawing.Graphics]::FromImage($imgForGraph) #Converting image to stop indexed image error on GIFs
							$graph.DrawImage($imgWithLines, 0, 0)
							
							[System.Drawing.Pen] $pen = New-Object System.Drawing.Pen([System.Drawing.Color]::Green, $script:lineThickness)
							$graph.DrawLine($pen, 0, (((($CropCoords.MaxY - $CropCoords.MinY)/2)+$CropCoords.MinY) * $imageCalcRatio), $originalImageWidth, (((($CropCoords.MaxY - $CropCoords.MinY)/2)+$CropCoords.MinY) * $imageCalcRatio))
							$graph.DrawLine($pen, (((($CropCoords.MaxX - $CropCoords.MinX)/2)+$CropCoords.MinX) * $imageCalcRatio), 0, (((($CropCoords.MaxX - $CropCoords.MinX)/2)+$CropCoords.MinX) * $imageCalcRatio), $originalImageHeight)
							$graph.Dispose()
							
							$PictureBox.Image = $imgForGraph
							[System.Windows.Forms.Application]::DoEvents()
						}
						else
						{
							$imgWithLines = [System.Drawing.Image]::Fromfile("${InputImagePath}\${TempFile}")
							
							[System.Drawing.Graphics] $graph = [System.Drawing.Graphics]::FromImage($imgWithLines)
							[System.Drawing.Pen] $pen = New-Object System.Drawing.Pen([System.Drawing.Color]::Green, $script:lineThickness)
							$graph.DrawLine($pen, 0, (((($CropCoords.MaxY - $CropCoords.MinY)/2)+$CropCoords.MinY) * $imageCalcRatio), $originalImageWidth, (((($CropCoords.MaxY - $CropCoords.MinY)/2)+$CropCoords.MinY) * $imageCalcRatio))
							$graph.DrawLine($pen, (((($CropCoords.MaxX - $CropCoords.MinX)/2)+$CropCoords.MinX) * $imageCalcRatio), 0, (((($CropCoords.MaxX - $CropCoords.MinX)/2)+$CropCoords.MinX) * $imageCalcRatio), $originalImageHeight)
							$graph.Dispose()
							$PictureBox.Image = $imgWithLines
							[System.Windows.Forms.Application]::DoEvents()
						}
						################################################
						
						$img = [System.Drawing.Image]::Fromfile("${InputImagePath}\${TempFile}")
						#Crop the Image using Smart Crop Coords
						$sizeInPixels = 648
						
						$img = CropImageSquare -img $img -MinX  ($CropCoords.MinX * $imageCalcRatio) -MaxX  ($CropCoords.MaxX * $imageCalcRatio) -MinY ($CropCoords.MinY * $imageCalcRatio) -MaxY ($CropCoords.MaxY * $imageCalcRatio) -sizeInPixels 648
						
						#Colourise
						[string] $colouriseString = $ColouriseDropDownBox.SelectedItem.ToString()
						if($colouriseString -ne "None")
						{
							$img = RGBFilter -img $img -Colour $colouriseString
						}
						
						#Contrast Image
						[string] $contrastString = $ContrastDropDownBox.SelectedItem.ToString()
						if($contrastString -ne "None")
						{
							$img = ContrastBoost -img $img -Amount $contrastString
						}
						
						$brightnessString = $BrightnessDropDownBox.SelectedItem.ToString()
						if($brightnessString -ne "None")
						{
							$img = BrightnessBoost -img $img -Amount $brightnessString
						}
						
						#Effects filter
						$effectsString = $EffectsDropDownBox.SelectedItem.ToString()
						if($effectsString -ne "None")
						{
							$img = InstaFilter -img $img -filtertype $effectsString
						}
						
						#Export the Image to file
						$OutputFileNameMinusExtension = $TempFile.Substring(0, $TempFile.Length - 4)
						ExportFile -bmp $img -imageTarget "$OutputImagePath\${OutputFileNameMinusExtension} ${sizeInPixels}x${sizeInPixels}.jpg"
					}
					
					if($Size96CheckBox.Checked)
					{
						if($SmartCropCheckBox.Checked -eq $true)
						{
							#Find cropping co-ordinates
							$CropCoords = SmartCropCoords -img $processimg -outsize 96 -scaleratio $imageCalcRatio
						}
