}

function ManualSmartCrop([System.Drawing.Image] $img)
{	
	$originalImageWidth = $img.Width
	Write-Host "Original Width: $originalImageWidth"
	$originalImageHeight = $img.Height
	Write-Host "Original Height: $originalImageHeight"
	$script:imageCalcRatioManual = 0 

	if($originalImageWidth -lt $originalImageHeight)
	{
		$SmallSide = $originalImageWidth
		$script:imageCalcRatioManual = $originalImageWidth / $SmartCropImageSize
		$img = ResizeImageWidthRetainRatio -img $img -widthInPixels $SmartCropImageSize
		[System.Windows.Forms.Application]::DoEvents()
		
		$script:lineThickness = $originalImageWidth / 100
		[int] $script:moveAmount = $originalImageWidth / 280  #300
	}
	else
	{
		$SmallSide = $originalImageHeight
		$script:imageCalcRatioManual = $originalImageHeight / $SmartCropImageSize
		$img = ResizeImageHeightRetainRatio -img $img -heightInPixels $SmartCropImageSize
		[System.Windows.Forms.Application]::DoEvents()
		
		$script:lineThickness = $originalImageHeight / 100
		[int] $script:moveAmount = $originalImageWidth / 280   #300
	}
	
	#Do initial processing on image
	$img = ProcessImage -img $img
	$PictureBox.Image = $img
	[System.Windows.Forms.Application]::DoEvents()
		
	#Erode the image
	$img = ErodeImage -img $img
	$PictureBox.Image = $img
	[System.Windows.Forms.Application]::DoEvents()
	
	#Erode a second time
	#$img = ErodeImage -img $img
	#$PictureBox.Image = $img
	#[System.Windows.Forms.Application]::DoEvents()
	
	#Find cropping co-ordinates
	$CropCoords = SmartCropCoords -img $img -outsize 48 -scaleratio $script:imageCalcRatioManual
	
	$img = [System.Drawing.Image]::Fromfile($script:manualImageFile)
		
	$script:manualRectMinX = $CropCoords.MinX
	$script:manualRectMinY = $CropCoords.MinY
	$script:manualRectMaxX = $CropCoords.MaxX
	$script:manualRectMaxY = $CropCoords.MaxY
	
	[int]$ActualWidth = ($script:manualRectMaxX * $script:imageCalcRatioManual) - ($script:manualRectMinX * $script:imageCalcRatioManual) 
	[int]$ActualHeight = $ActualWidth #Values turn out a few pixels off square which could confuse users, so i'm forcing it square.
	#[int]$ActualHeight = ($script:manualRectMaxY * $script:imageCalcRatioManual) - ($script:manualRectMinY * $script:imageCalcRatioManual)
	$SelectionSizeLabel.Text = "Size: $ActualWidth x $ActualHeight Pixels"
	
	if($script:manualImageFile -imatch ".gif") #GIFs need some extra processing
	{
		$imgForGraph = New-Object System.Drawing.Bitmap($img.Width, $img.Height)
		[System.Drawing.Graphics] $graph = [System.Drawing.Graphics]::FromImage($imgForGraph) #Converting image to stop indexed image error on GIFs
		$graph.DrawImage($img, 0, 0)
		
		[System.Drawing.Pen] $pen = New-Object System.Drawing.Pen([System.Drawing.Color]::Red, $lineThickness)
	
		$graph.DrawRectangle($pen,($script:manualRectMinX * $script:imageCalcRatioManual), ($script:manualRectMinY * $script:imageCalcRatioManual), (($script:manualRectMaxX - $script:manualRectMinX) * $script:imageCalcRatioManual), (($script:manualRectMaxY - $script:manualRectMinY) * $script:imageCalcRatioManual))
		$graph.Dispose()
		
		$PictureBox.Image = $imgForGraph
		$imgForGraph = $null
	}
	else
	{
		[System.Drawing.Graphics] $graph = [System.Drawing.Graphics]::FromImage($img)
		
		[System.Drawing.Pen] $pen = New-Object System.Drawing.Pen([System.Drawing.Color]::Red, $lineThickness)
	
		$graph.DrawRectangle($pen,($script:manualRectMinX * $script:imageCalcRatioManual), ($script:manualRectMinY * $script:imageCalcRatioManual), (($script:manualRectMaxX - $script:manualRectMinX) * $script:imageCalcRatioManual), (($script:manualRectMaxY - $script:manualRectMinY) * $script:imageCalcRatioManual))
		$graph.Dispose()
		
		$PictureBox.Image = $img
		$img = $null
	}	

}

function ProcessImage([System.Drawing.Image] $img)
{
	Write-Host "Doing initial processing on image...." -foreground "green"
	
	$p = New-Object System.Drawing.Bitmap($img)
	$result = New-Object System.Drawing.Bitmap($img.Width, $img.Height)
	 	
	# Get Start Time
	$startDTMScan = (Get-Date)

	
	<# Test Settings
	[float]$YMin = -0.63
	[float]$YMax = 1
	[float]$CbMin = -0.4
	[float]$CbMax = 0.05
	[float]$CrMin = 0.04
	[float]$CrMax = 0.16
	#>
	
	#Test settings Kukhare and Novosielski 2004 [Y > 80], [85 < Cb < 135], and [135 < Cr < 180]
	[float]$YMin = 0.3137
	[float]$YMax = 1
	[float]$CbMin = -0.1666
	[float]$CbMax = 0.0294
	[float]$CrMin = 0.0294
	[float]$CrMax = 0.2058
	
	<#
	#Test settings Chai and Ngan [77 <= Cb <= 127], and [133 <= Cr <= 173]
	[float]$YMin = 0.3137
	[float]$YMax = 1
	[float]$CbMin = -0.198
	[float]$CbMax = 0.0098
	[float]$CrMin = 0.02156
	[float]$CrMax = 0.1784
	#>
	
	<#
	#Test settings Jianguo Wang [60, 235], [90, 127], [129, 173]
	[float]$YMin = 0.2352
	[float]$YMax = 0.921
	[float]$CbMin = -0.147
	[float]$CbMax = -0.00196
	[float]$CrMin = 0.00588
	[float]$CrMax = 0.178
	#>
	
	$Black = [System.Drawing.Color]::Black
	$White = [System.Drawing.Color]::White
	[System.Drawing.Color] $pixelColor = [System.Drawing.Color]::White
	
	# Threshold every pixel	
	for ($y = 0; $y -lt $p.Height; $y++)
	{
		for ($x = 0; $x -lt $p.Width; $x++)
		{
			$pixelColor = $p.GetPixel($x,$y)
			
			$rf = $pixelColor.R * $factor
			$gf = $pixelColor.G * $factor
			$bf = $pixelColor.B * $factor 
			
			$yp = (0.257 * $rf + 0.504 * $gf + 0.098 * $bf)
			$cb = (-0.148 * $rf + -0.291 * $gf + 0.439 * $bf)
			$cr = (0.439 * $rf + -0.368 * $gf + -0.071 * $bf)
			
			
			#Write-Host "COLOUR: Y: $yp CB: $cb CR: $cr    RGB: R: $rf G: $gf B: $bf"  ## Debug
			if ($yp -ge $YMin -and $yp -le $YMax -and $cb -ge $CbMin -and $cb -le $CbMax -and $cr -ge $CrMin -and $cr -le $CrMax)
			{
				#Write-Host "COLOUR: Y: $yp CB: $cb CR: $cr    RGB: R: " ($rf*255) " G: " ($gf*255) " B: " ($bf*255)  ## Debug
				$result.SetPixel($x,$y,$White)
			}
			else
			{
				$result.SetPixel($x,$y,$Black)
			}
		}
	}
		
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Colour Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds" -foreground "yellow"
	
	return $result
}



function RGBFilter([System.Drawing.Image] $img, [string] $Colour)
{
	Write-Host "Changing Image Colour ($Colour)..." -foreground "green"
	
	# Get Start Time
	$startDTMScan = (Get-Date)
	
	$p = New-Object System.Drawing.Bitmap($img)
	$result = New-Object System.Drawing.Bitmap($img.Width, $img.Height)
	
	[float]$Rscale = 1
	[float]$Gscale = 1
	[float]$Bscale = 1

	if($Colour -eq  "Blue")
	{
		$Rscale = 0.93
		$Gscale = 0.93
		$Bscale = 1
	}
	elseif($Colour -eq  "Red")
	{
		$Rscale = 1
		$Gscale = 0.93
		$Bscale = 0.93
	}
	elseif($Colour -eq  "Green")
	{
		$Rscale = 1
		$Gscale = 1
		$Bscale = 0.93
	}
	elseif($Colour -eq  "Yellow")
	{
		$Rscale = 1
		$Gscale = 1
		$Bscale = 0.93
	}
	elseif($Colour -eq  "Orange")
	{
		$Rscale = 1
		$Gscale = 0.95
		$Bscale = 0.85
	}
	elseif($Colour -eq  "Purple")
	{
		$Rscale = 0.95
		$Gscale = 0.90
		$Bscale = 1
	}
	elseif($Colour -eq  "Pink")
	{
		$Rscale = 1
		$Gscale = 0.95
		$Bscale = 1
	}
	
	# Test every pixel	
	for ($y = 0; $y -lt $p.Height; $y++)
	{
		for ($x = 0; $x -lt $p.Width; $x++)
		{
			$pixelColor = $p.GetPixel($x,$y)
			
			$rf = $pixelColor.R * $Rscale
			$gf = $pixelColor.G * $Gscale
			$bf = $pixelColor.B * $Bscale 
						
			$result.SetPixel($x,$y,[System.Drawing.Color]::FromArgb($rf,$gf,$bf))
		}
	}
	
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Colourise Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"
	
	return $result
}


