function ContrastBoost([System.Drawing.Image] $img, [string] $Amount)
{
	Write-Host "Changing Image Contrast..." -foreground "green"
	
	# Get Start Time
	$startDTMScan = (Get-Date)
	
	$p = New-Object System.Drawing.Bitmap($img)
	$result = New-Object System.Drawing.Bitmap($img.Width, $img.Height)
	
	$contrast = 0

	if($Amount -eq "Reduce Contrast")
	{
		$contrast = -10
	}
	elseif($Amount -eq "Light Contrast Boost")
	{
		$contrast = 15
	}
	elseif($Amount -eq "Medium Contrast Boost")
	{
		$contrast = 20
	}
	elseif($Amount -eq "Mega Contrast Boost")
	{
		$contrast = 25
	}
	elseif($Amount -eq "Ultra Contrast Boost")
	{
		$contrast = 35
	}
	$contrast = (100.0 + $contrast) / 100.0
	$contrastAmount = $contrast * $contrast
	
	
	# Contrast every pixel	
	for ($y = 0; $y -lt $p.Height; $y++)
	{
		for ($x = 0; $x -lt $p.Width; $x++)
		{
			$pixelColor = $p.GetPixel($x,$y)
			
			[double] $rf = $pixelColor.R / 255.0
			$rf =  [Math]::Truncate(((($rf - 0.5) * $contrastAmount) + 0.5) * 255)
			
			[double] $gf = $pixelColor.G / 255.0
			$gf = [Math]::Truncate(((($gf - 0.5) * $contrastAmount) + 0.5) * 255) 
			
			[double] $bf = $pixelColor.B / 255.0
			$bf = [Math]::Truncate(((($bf - 0.5) * $contrastAmount) + 0.5) * 255)
			
			if($rf -gt 255){$rf = 255}
			if($gf -gt 255){$gf = 255}
			if($bf -gt 255){$bf = 255}
			if($rf -lt 0){$rf = 0}
			if($gf -lt 0){$gf = 0}
			if($bf -lt 0){$bf = 0}
						
			#Write-Host "OUT2 R: $rf G: $gf B: $bf" ## Debug
			$result.SetPixel($x,$y,[System.Drawing.Color]::FromArgb($rf,$gf,$bf))
		}
	}
	
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Contrast Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"
	
	return $result
}

function BrightnessBoost([System.Drawing.Image] $img, [string] $Amount)
{
	Write-Host "Changing Image Brightness..." -foreground "green"
	
	# Get Start Time
	$startDTMScan = (Get-Date)
	
	$p = New-Object System.Drawing.Bitmap($img)
	$result = New-Object System.Drawing.Bitmap($img.Width, $img.Height)

	[int]$brightness = 0
	if($Amount -eq "Light Brightness Boost")
	{
		$brightness = 15
	}
	elseif($Amount -eq "Medium Brightness Boost")
	{
		$brightness = 25
	}
	elseif($Amount -eq "Mega Brightness Boost")
	{
		$brightness = 35
	}
	elseif($Amount -eq "Ultra Brightness Boost")
	{
		$brightness = 50
	}
	elseif($Amount -eq "Reduce Brightness")
	{
		$brightness = -15
	}
	
	# Brightness every pixel	
	for ($y = 0; $y -lt $p.Height; $y++)
	{
		for ($x = 0; $x -lt $p.Width; $x++)
		{
			$pixelColor = $p.GetPixel($x,$y)
			
			$rf = $pixelColor.R
			$gf = $pixelColor.G
			$bf = $pixelColor.B
			
			$rf += $brightness
			$gf += $brightness
			$bf += $brightness

		
			if($rf -gt 255){$rf = 255}
			if($gf -gt 255){$gf = 255}
			if($bf -gt 255){$bf = 255}
			if($rf -lt 0){$rf = 0}
			if($gf -lt 0){$gf = 0}
			if($bf -lt 0){$bf = 0}
						
			#Write-Host "OUT R: $rf G: $gf B: $bf" ## Debug
			$result.SetPixel($x,$y,[System.Drawing.Color]::FromArgb($rf,$gf,$bf))
		}
	}
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Brightness Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"
	
	return $result
}


