				$topPixel = $null
				$bottomPixel = $null
				
				if($x -gt 1)
				{
					$leftPixel = $originalImage.GetPixel($x-1,$y)
				}
				if($x -lt ($originalImage.Width - 1))
				{
					$rightPixel = $originalImage.GetPixel($x+1,$y)
				}
				if($y -lt ($originalImage.Height - 1))
				{
					$topPixel = $originalImage.GetPixel($x,$y+1)
				}
				if($y -gt 1)
				{
					$bottomPixel = $originalImage.GetPixel($x,$y-1)
				}
				
				if ($leftPixel -ne $null -and $leftPixel.R -eq 0)
				{
					$resultImage.SetPixel($x,$y,$Black)
				}
				elseif($rightPixel -ne $null -and $rightPixel.R -eq 0)
				{
					$resultImage.SetPixel($x,$y,$Black)
				}
				elseif($topPixel -ne $null -and $topPixel.R -eq 0)
				{
					$resultImage.SetPixel($x,$y,$Black)
				}
				elseif($bottomPixel -ne $null -and $bottomPixel.R -eq 0)
				{
					$resultImage.SetPixel($x,$y,$Black)
				}
				else
				{
					$resultImage.SetPixel($x,$y,$White)
				}
			}
			else
			{
				$resultImage.SetPixel($x,$y,$Black)
			}
		}
	}
	
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Erode Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"	
	
	return $resultImage
}

function DilateImage([System.Drawing.Image] $img)
{
	# Get Start Time
	$startDTMScan = (Get-Date)
	Write-Host "Dilate Image..."  -foreground "green"
	
	$originalImage = New-Object System.Drawing.Bitmap($img)
	$resultImage = New-Object System.Drawing.Bitmap($img.Width, $img.Height)
	
	$Black = [System.Drawing.Color]::Black
	$White = [System.Drawing.Color]::White
	
	for ($y = 0; $y -lt $originalImage.Height; $y++)
	{
		for ($x = 0; $x -lt $originalImage.Width; $x++)
		{
			[System.Drawing.Color] $centrePixel = $originalImage.GetPixel($x,$y)
						
			if ($centrePixel.R -eq 0)
			{
				$leftPixel = $null
				$rightPixel = $null
				$topPixel = $null
				$bottomPixel = $null
				
				if($x -gt 1)
				{
					$leftPixel = $originalImage.GetPixel($x-1,$y)
				}
				if($x -lt ($originalImage.Width - 1))
				{
					$rightPixel = $originalImage.GetPixel($x+1,$y)
				}
				if($y -lt ($originalImage.Height - 1))
				{
					$topPixel = $originalImage.GetPixel($x,$y+1)
				}
				if($y -gt 1)
				{
					$bottomPixel = $originalImage.GetPixel($x,$y-1)
				}
				
				if ($leftPixel -ne $null -and $leftPixel.R -eq 255)
				{
					$resultImage.SetPixel($x,$y,$White)
				}
				elseif($rightPixel -ne $null -and $rightPixel.R -eq 255)
				{
					$resultImage.SetPixel($x,$y,$White)
				}
				elseif($topPixel -ne $null -and $topPixel.R -eq 255)
				{
					$resultImage.SetPixel($x,$y,$White)
				}
				elseif($bottomPixel -ne $null -and $bottomPixel.R -eq 255)
				{
					$resultImage.SetPixel($x,$y,$White)
				}
				else
				{
					$resultImage.SetPixel($x,$y,$Black)
				}
			}
			else
			{
				$resultImage.SetPixel($x,$y,$White)
			}
			
		}
	}
		
	return $resultImage
	
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Dilate Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"
}


function ExportFile([System.Drawing.Image] $bmp, [string] $imageTarget)
{
	Write-Host "Output File: $imageTarget" -foreground "green"
	[int]$quality = $QualityNumberBox.Value
	
	#Encoder parameter for image quality
	$myEncoder = [System.Drawing.Imaging.Encoder]::Quality
	$encoderParams = New-Object System.Drawing.Imaging.EncoderParameters(1)
	$encoderParams.Param[0] = New-Object System.Drawing.Imaging.EncoderParameter($myEncoder, $quality)
	# get codec
	$myImageCodecInfo = [System.Drawing.Imaging.ImageCodecInfo]::GetImageEncoders()|where {$_.MimeType -eq 'image/jpeg'}
	
	#save to file
	$bmp.Save($imageTarget,$myImageCodecInfo, $($encoderParams))
	$bmp.Dispose()
}


function CropImageSquare([System.Drawing.Image] $img, [int] $MinX, [int] $MaxX, [int] $MinY, [int] $MaxY, [int] $sizeInPixels)
{
	$imgResized = New-Object System.Drawing.Bitmap($sizeInPixels, $sizeInPixels)
	$graph = [System.Drawing.Graphics]::FromImage($imgResized)
	 
	$graph.Clear([System.Drawing.Color]::White)
	$rectangle = New-Object System.Drawing.Rectangle(0, 0, $sizeInPixels, $sizeInPixels)
	
	$CropXStart = $MinX
	$CropYStart = $MinY
	$CropBoxX = $MaxX - $MinX
	$CropBoxY = $MaxY - $MinY
	
	$graph.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
	$graph.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::HighQuality
	$graph.CompositingQuality = [System.Drawing.Drawing2D.CompositingQuality]::HighQuality
	$graph.PixelOffsetMode = [System.Drawing.Drawing2D.PixelOffsetMode]::HighQuality
	$graph.DrawImage($img,$rectangle, $CropXStart, $CropYStart, $CropBoxX, $CropBoxY,  [System.Drawing.GraphicsUnit]::Pixel)
	
	return $imgResized
}

function ResizeImageSquare([System.Drawing.Image] $img, [int] $startX, [int] $startY, [int] $sizeInPixels)
{
	$imgResized = New-Object System.Drawing.Bitmap($sizeInPixels, $sizeInPixels)
	$graph = [System.Drawing.Graphics]::FromImage($imgResized)
	 
	$graph.Clear([System.Drawing.Color]::White)
	$rectangle = New-Object System.Drawing.Rectangle($startX, $startY, $sizeInPixels, $sizeInPixels)
	
	$graph.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
	$graph.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::HighQuality
	$graph.CompositingQuality = [System.Drawing.Drawing2D.CompositingQuality]::HighQuality
	$graph.PixelOffsetMode = [System.Drawing.Drawing2D.PixelOffsetMode]::HighQuality
	$graph.DrawImage($img,$rectangle, 0,0, $img.Width, $img.Height,  [System.Drawing.GraphicsUnit]::Pixel)
	
	$img.Dispose()
	return $imgResized
}


function ResizeImageWidthRetainRatio([System.Drawing.Image] $img, [int] $widthInPixels)
{
	$imgWidth = $img.Width
	$imgHeight = $img.Height
	$ratio = $widthInPixels / $imgWidth
	[int] $heightInPixels = $imgHeight*$ratio
	Write-Host "Input Image Size: $widthInPixels x $heightInPixels Pixels" 
	$imgResized = New-Object System.Drawing.Bitmap($widthInPixels, $heightInPixels)
	$graph = [System.Drawing.Graphics]::FromImage($imgResized)
	 
	$graph.Clear([System.Drawing.Color]::White)
	$rectangle = New-Object System.Drawing.Rectangle(0, 0, $widthInPixels, $heightInPixels)
	
	$graph.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
	$graph.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::HighQuality
	$graph.CompositingQuality = [System.Drawing.Drawing2D.CompositingQuality]::HighQuality
	$graph.PixelOffsetMode = [System.Drawing.Drawing2D.PixelOffsetMode]::HighQuality
	$graph.DrawImage($img,$rectangle, 0,0, $imgWidth, $imgHeight,  [System.Drawing.GraphicsUnit]::Pixel)
	
	$img.Dispose()
	return $imgResized
}

function ResizeImageHeightRetainRatio([System.Drawing.Image] $img, [int] $heightInPixels)
{
	$imgWidth = $img.Width
	$imgHeight = $img.Height
	$ratio = $heightInPixels / $imgHeight
	[int] $widthInPixels = $imgWidth*$ratio
	$imgResized = New-Object System.Drawing.Bitmap([int]($imgWidth*$ratio), $heightInPixels)
	$graph = [System.Drawing.Graphics]::FromImage($imgResized)
	 
	$graph.Clear([System.Drawing.Color]::White)
	$rectangle = New-Object System.Drawing.Rectangle(0, 0, $widthInPixels, $heightInPixels)
	
	$graph.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic
	$graph.SmoothingMode = [System.Drawing.Drawing2D.SmoothingMode]::HighQuality
	$graph.CompositingQuality = [System.Drawing.Drawing2D.CompositingQuality]::HighQuality
	$graph.PixelOffsetMode = [System.Drawing.Drawing2D.PixelOffsetMode]::HighQuality
	$graph.DrawImage($img,$rectangle, 0,0, $imgWidth, $imgHeight,  [System.Drawing.GraphicsUnit]::Pixel)
	
	$img.Dispose()
	return $imgResized
}

function SmartCropCoords([System.Drawing.Image] $img, [int] $outsize, [float] $scaleratio)
{
	
	# Get Start Time
	$startDTMScan = (Get-Date)
	Write-Host "Finding Smart Crop Co-ords..."  -foreground "green"
	
	$originalImage = New-Object System.Drawing.Bitmap($img)
	
	#############COUNT THE WHITE PIXELS################
	$TotalImageWhitePixels = 0
	
	$PixelCount = 0
	
	# Count every pixel
	for ($y = 0; $y -lt $originalImage.Height; $y++)
	{
		for ($x = 0; $x -lt $originalImage.Width; $x++)
		{
			[System.Drawing.Color] $centrePixel = $originalImage.GetPixel($x,$y)
						
			if ($centrePixel.R -eq 255)
			{
				$PixelCount++ 
			}
		}
	}
	$TotalImageWhitePixels = $PixelCount
	#Write-Host "Total Number of pixels: $TotalImageWhitePixels" ## Debug
	###################################################################
	
	if($TotalImageWhitePixels -gt 2)
	{
		
		#######CREATE X AND Y HISTOGRAMS###################################
		$HistogramRows = @()
		$HistogramColumns = @()
		
		$RowAdded = 0
		$ColumnAdded = 0
		
		# Create the Row Histogram
		for ($y = 0; $y -lt $originalImage.Height; $y++)
		{
			for ($x = 0; $x -lt $originalImage.Width; $x++)
			{
				[System.Drawing.Color] $centrePixel = $originalImage.GetPixel($x,$y)
							
				if ($centrePixel.R -eq 255)
				{
					$RowAdded++ 
				}
			}
			$HistogramRows += $RowAdded
			$RowAdded = 0
		}
		
		# Create the Column Histogram
		for ($x = 0; $x -lt $originalImage.Width; $x++)
		{
			for ($y = 0; $y -lt $originalImage.Height; $y++)
			{
				[System.Drawing.Color] $centrePixel = $originalImage.GetPixel($x,$y)
							
				if ($centrePixel.R -eq 255)
				{
					$ColumnAdded++ 
				}
			}
			$HistogramColumns += $ColumnAdded
			$ColumnAdded = 0
		}
				
		###THE X AND Y WINDOW SIZES####
		[int] $RectangleSideShort = 10
		[int] $RectangleSideLong = 10
		###############################
		
		
		####CALCULATE ROW WINNER with WINDOW
		$currentLargestNumber = 0
		$RowWinner = 0
		$RowWindowTotal = 0
		for ($i=0; $i -lt $HistogramRows.length; $i++) 
		{
			for ($window = 0; $window -lt $RectangleSideLong; $window++)
			{
				$RowWindowTotal	+= $HistogramRows[$i+$window]
			}
			if($RowWindowTotal -gt $currentLargestNumber)
			{
				$currentLargestNumber = $RowWindowTotal
				[int]$RowWinner = $i + ($RectangleSideLong / 2) 
			}
			$RowWindowTotal = 0
		}
		#Write-Host "Row: $RowWinner, Value: $currentLargestNumber" ## Debug
		
		####CALCULATE COLUMN WINNER with WINDOW
		$currentLargestNumber = 0
		$ColumnWinner = 0
		$ColumnWindowTotal = 0
		for ($i=0; $i -lt $HistogramColumns.length; $i++) 
		{
			for ($window = 0; $window -lt $RectangleSideShort; $window++)
			{
				$ColumnWindowTotal += $HistogramColumns[$i+$window]
			}
			if($ColumnWindowTotal -gt $currentLargestNumber)
			{
				$currentLargestNumber = $ColumnWindowTotal
				[int]$ColumnWinner = $i + ($RectangleSideShort / 2)
			}
			$ColumnWindowTotal = 0
		}
		#Write-Host "Column: $ColumnWinner, Value: $currentLargestNumber" ## Debug
		###################################################################
				
		###Find where 90% of the pixels are ##############################
		$MinY = 0
		$MaxY = 0
		$MinX = 0
		$MaxX = 0
		
		$PixelsInField = $HistogramRows[$RowWinner]
		$PixelsInField += $HistogramRows[$ColumnWinner]
		
		if($HistogramRows.length -gt $HistogramColumns.length)
		{$loops = $HistogramRows.length}
		else
		{$loops = $HistogramColumns.length}
		
		$widthoforg = $originalImage.Width
		$heightoforg = $originalImage.Height
		
		
		$growOffsetX = 0
		$growOffsetY = 0
		$marginFlag = $false
		[int] $marginLoop = 0
		[int] $marginLoopMax = $MarginNumberBox.Value
		$OriginalImageScale = $outsize/$scaleratio
		#Write-Host "LOOP STARTING POINT: $ColumnWinner $RowWinner" ## Debug
		for ($i = 1; $i -lt $loops; $i++)
		{
			$ForwardAmount1 = 0
			$BackwardAmount1 = 0
			$ForwardAmount2 = 0
			$BackwardAmount2 = 0
			
			#Write-Host "CURRENT SIZE1: $MinY $MaxY  |  $MinX $MaxX" ## Debug
			
			if(($RowWinner + $i) -le ($HistogramRows.length - 2))
			{
				$ForwardAmount1 += $HistogramRows[$RowWinner + $i + $growOffsetX]
				$MaxY = $RowWinner + $i + $growOffsetX
			}
			if($MinY -le 1 -and $MaxY -le ($heightoforg - 1))
			{
				$growOffsetX++
				$BackwardAmount1 += $HistogramRows[$RowWinner + $i + $growOffsetX]
			}
			#Write-Host "CURRENT SIZE2: $MinY $MaxY  |  $MinX $MaxX" ## Debug
			
			if(($RowWinner - $i) -ge 2)
			{
				$BackwardAmount1 += $HistogramRows[$RowWinner - $i - $growOffsetX]
				$MinY = $RowWinner - $i - $growOffsetX
			}
			if($MaxY -ge ($heightoforg - 1) -and $MinY -ge 1)
			{
				$growOffsetX++
				$ForwardAmount1 += $HistogramRows[$RowWinner - $i - $growOffsetX]
			}
			#Write-Host "CURRENT SIZE3: $MinY $MaxY  |  $MinX $MaxX" ## Debug
			
			if(($ColumnWinner + $i) -le ($HistogramColumns.length - 2))
			{
				$ForwardAmount2 += $HistogramColumns[$ColumnWinner + $i + $growOffsetY]
				$MaxX = $ColumnWinner + $i + $growOffsetY
			}
			if($MinX -le 1 -and $MaxX -le ($widthoforg - 1))
			{
				$growOffsetY++
				$BackwardAmount2 += $HistogramColumns[$ColumnWinner + $i + $growOffsetY]
			}
			#Write-Host "CURRENT SIZE4: $MinY $MaxY  |  $MinX $MaxX" ## Debug

			if(($ColumnWinner - $i) -ge 2)
			{
				$BackwardAmount2 += $HistogramColumns[$ColumnWinner - $i - $growOffsetY]
				$MinX = $ColumnWinner - $i - $growOffsetY
			}
			if($MaxX -ge ($widthoforg - 1) -and $MinX -ge 1)
			{
				$growOffsetY++
				$ForwardAmount2 += $HistogramColumns[$ColumnWinner - $i - $growOffsetY]
			}
			
			#Write-Host "CURRENT SIZE5: $MinY $MaxY  |  $MinX $MaxX" ## Debug
			
			#Avoid cases where max values fall through as 0
			if($MaxY -eq 0){$MaxY = $heightoforg}
			if($MaxX -eq 0){$MaxX = $widthoforg}
			
			#TEST EDGES
			if($MinX -le 1 -and $MaxX -ge ($widthoforg - 1))
			{
				#Write-Host "ROW BREAK" ## Debug	
				break
			}
			if($MinY -le 1 -and $MaxY -ge ($heightoforg - 1))
			{
				#Write-Host "COLUMN BREAK" ## Debug
				break
			}
						
			$PixelsInField += ($ForwardAmount1 + $BackwardAmount1 + $ForwardAmount2 + $BackwardAmount2)
			[float]$percentage = ($PixelsInField/($TotalImageWhitePixels*2))
			#Write-Host "PECENTAGE: $percentage" ## Debug
			if($percentage -gt 0.90 -and (($MaxY - $MinY)) -gt ($OriginalImageScale))
			{
				#Write-Host "PIXEL BREAK: $TotalImageWhitePixels  Pixels in Field: $PixelsInField" ## Debug 
				$marginFlag = $true
			}
			
			#Put a margin around the image
			if($marginFlag)
			{
				if($marginLoop -ge $marginLoopMax)
				{
					#Write-Host "MARGIN BREAK: $TotalImageWhitePixels  Pixels in Field: $PixelsInField" ## Debug
					break
				}
				$marginLoop++
			}

			if($i -gt $loops)
			{
				#Write-Host "LOOP BREAK" ## Debug
				break
			}
			#Write-Host "TOTAL PIXELS: $TotalImageWhitePixels  Pixels in Field: $PixelsInField" ## Debug
		}
		
		#Pack Response
		$ResponseHash = @{            
        MinX = $MinX                 
        MaxX = $MaxX           
        MinY = $MinY
		MaxY = $MaxY
		}
	}
	else
	{
		Write-Host "Not enough white pixels. Doing centre crop..."
		$originalImageWidth = $originalImage.Width
		$originalImageHeight = $originalImage.Height
		if($originalImageWidth -lt $originalImageHeight)
		{
			#Pack Response
			$ResponseHash = @{            
				MinX = 0                 
				MaxX = $originalImageWidth           
				MinY = ($originalImageHeight / 2) - ($originalImageWidth / 2)
				MaxY = ($originalImageHeight / 2) + ($originalImageWidth / 2)
			}
		}
		else
		{
			#Pack Response
			$ResponseHash = @{            
				MinX = ($originalImageWidth / 2) - ($originalImageHeight / 2)               
				MaxX = ($originalImageWidth / 2) + ($originalImageHeight / 2)           
				MinY = 0
				MaxY = $originalImageHeight
			}
		}
	}
	
	#Write-Host "RESPONSE HASH: " $ResponseHash.MinX " " $ResponseHash.MaxX " " $ResponseHash.MinY " " $ResponseHash.MaxY ## Debug
	
	# Get End Time
	$endDTMScan = (Get-Date)
	# Echo Time elapsed
	Write-Host "Smart Crop Processing Time: $(($endDTMScan-$startDTMScan).totalseconds) seconds"  -foreground "yellow"

	return $ResponseHash
}


